import React, { useEffect, useState } from "react";
import "./App.css";
import Search from "./components/search";
import { getData } from "./utility/data.utilits";

type productData = {
    data: Product[];
};
type Product = {
    id: string;
    name: string;
    year: number;
    color: string;
    pantoneValue: string;
};

const App = () => {
    const [products, setProducts] = useState<Product[]>([]);

    useEffect(() => {
        const fetchData = async () => {
            const data = await getData<productData>(
                "https://reqres.in/api/products"
            );
            return setProducts(data["data"]);
        };

        products.forEach((x) => console.log(x));
    });
    return (
        <>
            <Search placeholder="esa" />
        </>
    );
};

export default App;
